        <div>
            <h2>{props.selectedActivity && props.selectedActivity.activity_name}</h2>
            <table className="item-table">
                <thead>
                <UsersRow users={props.users}/>
                </thead>
                <tbody>
                <Items users={props.users}
                    // items={props.selectedActivity && props.selectedActivity.items}
                       items={props.selectedActivity.items}
                       handleCheckboxClick={props.handlePurchaseClick}/>
                </tbody>
            </table>
        </div>
    )
}

